DROP TABLE IF EXISTS `admin`;
CREATE TABLE IF NOT EXISTS `admin` (
	`id`	int NOT NULL AUTO_INCREMENT,
	`aid`	varchar(10) NOT NULL UNIQUE,
	`name`	varchar(20),
	`gender`	varchar(2),
	PRIMARY KEY(`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 15205 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci ROW_FORMAT = Dynamic;
DROP TABLE IF EXISTS `role`;
CREATE TABLE IF NOT EXISTS `role` (
	`id`	int NOT NULL AUTO_INCREMENT,
	`rid`	varchar(10) NOT NULL UNIQUE,
	`password`	varchar(255) NOT NULL,
	`role`	varchar(6) NOT NULL CHECK(`role` IN ('学生', '辅导员', '教务处', '考勤', '管理员')),
	PRIMARY KEY(`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 15205 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci ROW_FORMAT = Dynamic;
DROP TABLE IF EXISTS `student`;
CREATE TABLE IF NOT EXISTS `student` (
	`id`	int NOT NULL AUTO_INCREMENT,
	`sid`	varchar(10) NOT NULL UNIQUE,
	`tid`	varchar(10),
	`name`	varchar(20),
	`gender`	varchar(2) CHECK(`gender` IN ('男', '女')),
	`department`	varchar(38),
	`faculty`	varchar(38),
	`major`	varchar(38),
	`grade`	varchar(4),
	`class`	varchar(2),
	PRIMARY KEY(`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 15205 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci ROW_FORMAT = Dynamic;
DROP TABLE IF EXISTS `teacher`;
CREATE TABLE IF NOT EXISTS `teacher` (
	`id`	int NOT NULL AUTO_INCREMENT,
	`tid`	varchar(10) NOT NULL UNIQUE,
	`name`	varchar(20),
	`gender`	varchar(2) CHECK(`gender` IN ('男', '女')),
	`telphone`	varchar(11) CHECK(length(`telphone`) = 11) UNIQUE,
	PRIMARY KEY(`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 15205 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci ROW_FORMAT = Dynamic;
DROP TABLE IF EXISTS `leave`;
CREATE TABLE IF NOT EXISTS `leave` (
	`id`	int NOT NULL AUTO_INCREMENT,
	`sid`	varchar(10) NOT NULL,
	`state`	varchar(6) CHECK(`state` IN ('待审批', '已撤回', '审批中', '已驳回', '待销假', '销假中', '已完成')),
	`category`	varchar(8) CHECK(`category` IN ('事假', '公假', '病假', '出校申请')),
	`apply_timestamp`	datetime DEFAULT CURRENT_TIMESTAMP,
	`start_timestamp`	datetime,
	`end_timestamp`	datetime,
	`reason`	text,
	`approver1_id`	varchar(10),
	`a1_timestamp`	datetime,
	`approver2_id`	varchar(10),
	`a2_timestamp`	datetime,
	`revoke_id`	varchar(10),
	`r_timestamp`	datetime,
	PRIMARY KEY(`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 15205 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci ROW_FORMAT = Dynamic;
